import React, {Component} from 'react';
import axios from 'axios';

export default class ReadDesc extends Component {

    constructor(props) {
        super(props);
        this.state = {description: []};
    }

    componentDidMount() {
        axios.get('http://localhost:4000/td/'+this.props.match.params.id)
            .then(response => {
                this.setState({description: response.data});
            })
            .catch(function (error) {
                console.log(error);
            })
    }

    render() {
        return (
            <div style={{ marginTop: 20 }}>
                <h3>Cat√°logo</h3>
                <table className="table table-striped" style={{ marginTop: 20 }}>
                    <thead>
                        <tr>
                            <th>Context</th>
                            <th>ID</th>
                            <th>Title</th>
                            <th>Security Definitions</th>
                            <th>Security</th>
                            <th>Properties</th>
                            <th>Actions</th>
                            <th>Events</th>
                        </tr>
                    </thead>
                    <tbody>
                        {this.state.description.context}
                        {this.state.description.id}
                        {this.state.description.title}
                        <span>
                        // This will go through all the elements in arrayFromJson and
                        // render each one as a <SomeComponent /> with data from the object
                        {this.state.arrayFromJson.map(function(object) {
                            return (
                            <SomeComponent key={object.id} data={this.state.description} />
                            );
                        })}
                        </span>
                        {this.state.description.securityDefinitions}
                        {this.state.description.security}
                        {this.state.description.properties}
                        {this.state.description.actions}
                        {this.state.description.events}
                    </tbody>
                </table>
            </div>
        )
    }
}
